// Import image
import sensor_icon from "../icons/sensor.png";
import camera_trap_icon from "../icons/camera_trap.png";

const SENSORS = [
    {"type": "camera_trap", "latitude":51.5094, "longitude":-2.5890, "id": 1, "icon": sensor_icon},
    {"type": "live_camera","latitude":51.5100,"longitude":-2.5957, "id": 2, "icon": sensor_icon},
    {"type": "live_camera","latitude":51.5080,"longitude":-2.5925, "id": 1, "icon": camera_trap_icon},
    {"type": "unique_public_source","latitude":51.5085,"longitude":-2.5950, "id": 1, "icon": camera_trap_icon}
];

export default SENSORS;
